DROP TABLE IF EXISTS `CONTENTS`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `CONTENTS` (
  `contents_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '고유번호',
  `cate1` varchar(10) NOT NULL COMMENT '대분류',
  `cate2` varchar(10) NOT NULL COMMENT '중분류',
  `userid` varchar(100) NOT NULL COMMENT '판매자아이디',
  `nickname` varchar(50) NOT NULL COMMENT '판매자닉네임',
  `lv` tinyint(1) NOT NULL DEFAULT '0' COMMENT '등급',
  `title` varchar(255) NOT NULL COMMENT '제목',
  `contents` text NOT NULL COMMENT '내용',
  `is_folder` enum('Y','N') NOT NULL DEFAULT 'N' COMMENT '폴더인지',
  `folder_name` varchar(255) DEFAULT NULL COMMENT '폴더명 또는 파일명',
  `size` bigint(20) NOT NULL DEFAULT '0' COMMENT '파일사이즈',
  `cash` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '판매금액',
  `is_adult` enum('Y','N') NOT NULL DEFAULT 'N' COMMENT '성인여부',
  `is_rights` enum('Y','N') NOT NULL DEFAULT 'N' COMMENT '제휴컨텐츠',
  `purchase` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '판매수',
  `down` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '다운수',
  `eva` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '평가횟수',
  `score` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '평가점수',
  `comment` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '댓글갯수',
  `color` varchar(255) NOT NULL COMMENT '제목컬러',
  `bold` enum('Y','N') NOT NULL DEFAULT 'N' COMMENT '볼드여부',
  `thumb` varchar(255) NOT NULL COMMENT '썸네일',
  `state` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '0:업로드중 1:진행중 2:오류 , 3:완료 , 4:삭제 ,5:기간만료',
  `wdate` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '등록일',
  `edate` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '만료일',
  `sdate` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '상태변경일',
  `sort` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '정렬',
  `init_key` varchar(100) NOT NULL COMMENT 'next_val key값',
  `main_img` varchar(255) NOT NULL COMMENT '대표이미지',
  `sub_img` text NOT NULL COMMENT '서브이미지들',
  `hash_tags` varchar(255) NOT NULL COMMENT '해시태그',
  `cid` varchar(100) NOT NULL COMMENT 'cid',
  `ccid` varchar(100) NOT NULL COMMENT 'ccid',
  `ccid_ver` varchar(100) NOT NULL COMMENT 'ccid_ver',
  `drm` enum('Y','N') NOT NULL DEFAULT 'N',
  `watermarking` enum('Y','N') NOT NULL DEFAULT 'N',
  `ipfs_json_data` text NOT NULL COMMENT 'ipfs json',
  `metainfo` varchar(100) NOT NULL COMMENT 'result.fileinfo.path',
  `dataid` varchar(100) NOT NULL COMMENT 'dataId',
  PRIMARY KEY (`contents_id`),
  KEY `cate1_index` (`cate1`),
  KEY `userid_index` (`userid`),
  KEY `state_index` (`state`),
  KEY `wdate_index` (`wdate`),
  KEY `edate_index` (`edate`),
  KEY `sdate_index` (`sdate`),
  KEY `sort_index` (`sort`),
  KEY `init_key_index` (`init_key`),
  KEY `dataid_index` (`dataid`)
) ENGINE=InnoDB AUTO_INCREMENT=803 DEFAULT CHARSET=utf8 COMMENT='컨텐츠리스트';
